import { useSelector } from "react-redux";


function CarList() {
    const cars = useSelector((state) => {
        return state.cars.data;
    });

    const renderedCars = cars.map((car) => {
        return (
            <div className="panel" key={car.id}>
                <p>
                    {car.name} - 
                </p>
            </div>
        )
    })
    return <div>CarList</div>;
}

export default CarList;
